import React from 'react';

class Pokemon extends React.Component {
  render() {
    const {name, type, averageWeight: {measurementUnit, value}, image} = this.props;
    return (
			<div className='pokemon'>
				<div>
					<p>{ name }</p>
						<p>{ type }</p>
						<p>{`Avarege weight: ${value} ${measurementUnit}`}</p>
					</div>
					<img src={ image } alt={ `${name} sprite` }/>
				</div>
      )
  }
}

export default Pokemon;
